import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Components/Navbar';
import Container from './Components/Container';
import Carousel from './Components/Carousel';
import Formulario from './Components/Formulario';
import PaginaDois from './Components/PaginaDois'; // Importe a página que você quer navegar

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar brand="Logo." links={[
          { state: 'active', name: "Cadastro de Produtos", path: "/formulario" }, 
          { state: "", name: "Gerenciamento", path: "/Gerenciamento.js" }, 
          { state: "", name: "OBTER LUCRO", path: "/Lucro." }
        ]} />

        <Container>
          <Switch>
            <Route path="/formulario" component={Formulario} />
            <Route path="/pagina-dois" component={PaginaDois} />
            <Route path="/carousel" component={Carousel} />
          </Switch>
        </Container>
      </div>
    </Router>
  );
}

export default App;
